import React, { useState } from 'react';

function MealFilterForm() {
    const [calorieMin, setCalorieMin] = useState('');
    const [calorieMax, setCalorieMax] = useState('');
    const [selectedMealType, setSelectedMealType] = useState('');
    const [selectedCuisineType, setSelectedCuisineType] = useState('');
    const [selectedDiets, setSelectedDiets] = useState([]);
    const [selectedHealth, setSelectedHealth] = useState([]);

    const mealTypes = ['Breakfast', 'Lunch', 'Dinner', 'Snack'];
    const cuisineTypes = ['Asian', 'American', 'Caribbean', 'Central Europe', 'Chinese', 'Eastern Europe', 'French', 'Indian', 'Italian', 'Japanese', 'Kosher', 'Mediterranean', 'Mexican', 'Middle Eastern', 'South American', 'South East Asian'];
    const diets = ['balanced', 'high-fiber', 'high-protein', 'low-carb', 'low-fat', 'low-sodium'];
    const healthOptions = ['dairy-free', 'egg-free', 'gluten-free', 'keto-friendly', 'low-sugar', 'peanut-free', 'vegan', 'vegetarian'];


    const handleSubmit = (e) => {
        e.preventDefault();
        // You can implement filtering logic here
        // 
        console.log("Filters submitted:", { calorieMin, calorieMax, selectedMealType, selectedCuisineType, selectedDiets, selectedHealth });
    };

    return (
        <form onSubmit={handleSubmit}>
            <div style={{ maxWidth: '900px' }}>
                <h5>Diet Options</h5>
                <div style={{ maxHeight: '200px', overflowY: 'auto' }}>
                    <div>
                        <label>
                            Min Calories:
                            <input type="text" width='25px' value={calorieMin} onChange={e => setCalorieMin(e.target.value)} />
                        </label>
                        <label>
                            Max Calories:
                            <input type="text" value={calorieMax} onChange={e => setCalorieMax(e.target.value)} />
                        </label>
                    </div>
                    <div>
                        <label>
                            Meal Type:
                            <select value={selectedMealType} onChange={e => setSelectedMealType(e.target.value)}>
                                <option value="">Select</option>
                                {mealTypes.map((type, index) => (
                                    <option key={index} value={type}>{type}</option>
                                ))}
                            </select>
                        </label>

                        <label>
                            Cuisine Type:
                            <select value={selectedCuisineType} onChange={e => setSelectedCuisineType(e.target.value)}>
                                <option value="">Select</option>
                                {cuisineTypes.map((type, index) => (
                                    <option key={index} value={type}>{type}</option>
                                ))}
                            </select>
                        </label>
                    </div>
                    <div>
                        <label>
                            Diet:
                            <select multiple value={selectedDiets} onChange={e => setSelectedDiets(Array.from(e.target.selectedOptions, option => option.value))}>
                                {diets.map((type, index) => (
                                    <option key={index} value={type}>{type}</option>
                                ))}
                            </select>
                        </label>
                    </div>
                    <div>
                        <label>
                            Health Preferences:
                            <select multiple value={selectedHealth} onChange={e => setSelectedHealth(Array.from(e.target.selectedOptions, option => option.value))}>
                                {healthOptions.map((type, index) => (
                                    <option key={index} value={type}>{type}</option>
                                ))}
                            </select>
                        </label>
                    </div>
                </div>
            </div>
            <button type="submit">Apply Filters</button>
        </form>
    );
                                }

export default MealFilterForm;
